  [],\n\t\"revision_timestamp\": \"2016-03-29T23:22:22.263389\",\n\t\"name\": \"latest-tarp-reports-the-supervisory-capital-assessment-program\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"A banking organization holds capital to
  guard against uncertainty. Capital reassures an institutionu2019s depositors, creditors
  and counterparties--and the institution itself--that an event such as an unexpected
  surge in losses or an unanticipated deterioration in earnings will not impair its
  ability to engage in lending to creditworthy borrowers and protect the savings of
  its depositors. During this period of heightened economic uncertainty, U.S. federal
  banking supervisors believe that the largest U.S. bank holding companies (BHCs)
  should have a capital buffer sufficient to withstand losses and allow them to meet
  the credit needs of their customers in a more severe recession than is anticipated.
  For this reason, the Federal Reserve and other bank supervisors embarked on a comprehensive
  simultaneous assessment of the capital held by the 19 largest U.S. BHCs in February
  of this year.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
